import styled from "styled-components";

export const Container = styled.table`
    max-width: 1120px;
    display: flex;
    align-items: center;
    justify-content: center;

    div {
        background: var(--shape);
        padding: 0.5rem;
        border-radius: 0.25rem;
    }

    td {
        display: inline-block;
        justify-content: space-around;
    }
`
